void tty_start() {
	// load tty process
	code_bytes_t* code = code_get_single_file("/bin/ottos_tty");
	if(code == NULL) {
		kernel_panic("Cannot start tty");
		return;
	}
	process_create(1, code);

	// TODO (thomas.bargetz@gmail.com) implement code_free function
	free(code->byte_0);
	free(code->byte_1);
	free(code->byte_2);
	free(code->byte_3);
	free(code);
}

